import Card from "./Card";
import style from "./Cards.module.css";

export default function Cards(props) {
  const { characters, onClose } = props;
  if(false){
    return (
      <div className={style.Cards}>
        {characters.map((el) => (
          <Card
            key={el.id}
            detailId={el.id}
            name={el.name}
            species={el.species}
            gender={el.gender}
            image={el.image}
            onClose={() => onClose(el.id)}
          />
        ))}
      </div>
    );
  }
  
}
